import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';

const ApplicationForm = () => {
  const { projectId } = useParams();
  const navigate = useNavigate();

  const [clientEmail, setClientEmail] = useState('');
  const [formData, setFormData] = useState({
    fullName: '',
    email: '',
    phoneNumber: '',
    linkedIn: '',
    githubLink: '',
    githubProject1: '',
    githubProject2: '',
    portfolioLink: ''
  });

  useEffect(() => {
    fetch(`http://localhost:8081/api/projects/${projectId}`)
      .then(res => res.json())
      .then(data => {
        setClientEmail(data.clientEmail);
      });
  }, [projectId]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const payload = { ...formData, clientEmail, projectId };

    const response = await fetch('http://localhost:8081/api/apply', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(payload),
    });

    const text = await response.text();
    if (response.ok) {
      alert('Application submitted successfully!');
      navigate('/');
    } else {
      alert('Failed to submit application: ' + text);
    }
  };

  const handleBack = () => {
    navigate('/categorydetails');
  };

  return (
    <div style={{
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      minHeight: '100vh',
      backgroundColor: '#f0f4f8',
      fontFamily: 'Segoe UI, sans-serif'
    }}>
      <div style={{
        display: 'flex',
        width: '900px',
        minHeight: '400px',
        backgroundColor: '#fff',
        borderRadius: '20px',
        boxShadow: '0 10px 30px rgba(0,0,0,0.1)',
        overflow: 'hidden'
      }}>
        {/* Left Panel */}
        <div style={{
          flex: 1,
          background: 'linear-gradient(135deg, #00c6ff, #0072ff)',
          color: '#fff',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          padding: '20px'
        }}>
          <h1 style={{ fontSize: '30px', fontWeight: 'bold', marginBottom: '6px' }}>SkillsFusion</h1>
          <p style={{ fontSize: '15px', textAlign: 'center' }}>Connect. Create. Collaborate.</p>
        </div>

        {/* Right Panel */}
        <div style={{
          flex: 1.3,
          padding: '30px',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'flex-start'
        }}>
          {/* Back Button */}
          <button
            onClick={handleBack}
            style={{
              alignSelf: 'flex-start',
              marginBottom: '20px',
              padding: '8px 16px',
              backgroundColor: '#007bff',
              color: 'white',
              border: 'none',
              borderRadius: '6px',
              cursor: 'pointer'
            }}
          >
            ← Back
          </button>

          <h2 style={{ fontSize: '22px', fontWeight: '600', marginBottom: '6px', color: '#002b5b' }}>
            Apply for Project
          </h2>
          <p style={{ marginBottom: '15px', color: '#555' }}>
            Submit your application for Project ID: {projectId}
          </p>

          <form onSubmit={handleSubmit}>
            {[ 
              { name: 'fullName', placeholder: 'Full Name', type: 'text' },
              { name: 'email', placeholder: 'Your Email', type: 'email' },
              { name: 'phoneNumber', placeholder: 'Phone Number', type: 'text' },
              { name: 'linkedIn', placeholder: 'LinkedIn URL', type: 'text' },
              { name: 'githubLink', placeholder: 'GitHub URL', type: 'text' },
              { name: 'githubProject1', placeholder: 'GitHub Project 1', type: 'text' },
              { name: 'githubProject2', placeholder: 'GitHub Project 2', type: 'text' },
              { name: 'portfolioLink', placeholder: 'Portfolio Link', type: 'text' },
            ].map((field, idx) => (
              <input
                key={idx}
                type={field.type}
                name={field.name}
                placeholder={field.placeholder}
                onChange={handleChange}
                required={['fullName', 'email', 'phoneNumber'].includes(field.name)}
                style={{
                  width: '100%',
                  padding: '10px 12px',
                  margin: '8px 0',
                  borderRadius: '8px',
                  border: '1px solid #ccc',
                  fontSize: '14px',
                  boxSizing: 'border-box'
                }}
              />
            ))}
            <div style={{ display: 'flex', justifyContent: 'flex-end', marginTop: '12px' }}>
              <button type="submit" style={{
                padding: '12px 24px',
                borderRadius: '8px',
                border: 'none',
                backgroundColor: '#00c6ff',
                color: 'white',
                fontWeight: 'bold',
                fontSize: '15px',
                cursor: 'pointer'
              }}>
                Submit
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default ApplicationForm;
